import React from "react";

export default class MessageList extends React.Component{
    constructor(){
        super()
    }
    render(){
        return (
            <ul className="list-group">
                <li className="list-group-item">
                    留言人：暴一品 内容：明天星期天 时间：2018.12.15
                </li>
            </ul>
        )
    }
}
